"use strict";(self.webpackChunkmetapage_docs=self.webpackChunkmetapage_docs||[]).push([[1477],{10:l=>{l.exports=JSON.parse('{"blogPosts":[{"id":"/7965915b-b0e5-401d-b5ad-246e4812aa97","metadata":{"permalink":"/blog/7965915b-b0e5-401d-b5ad-246e4812aa97","source":"@site/blog/metapage-URL-schema.mdx","title":"metapage URL schema","description":"The way URLs are constructed:","date":"2023-10-05T17:33:16.990Z","formattedDate":"October 5, 2023","tags":[],"readingTime":0.615,"hasTruncateMarker":false,"authors":[],"frontMatter":{"title":"metapage URL schema","sidebar_position":5,"slug":"/7965915b-b0e5-401d-b5ad-246e4812aa97"},"nextItem":{"title":"How to get SharedArrayBuffer and cross-domain isolation with metapage.io","permalink":"/blog/590e31dd-740b-43ce-9667-a2879651a392"}},"content":"The way URLs are constructed:\\n\\n- Need to be consistent with current and future planned behaviour\\n- Simple to understand\\n- Work with different methods of showing metapages\\n\\t- The official editor: app.metapage.io\\n\\t- The standalone viewer\\n\\t- Others\\n- Allow arbitrary path names\\n\\t- E.g. users can name a metapage `foo/bar/thing` and it shows up as `https://app.metapage.io/<user>/foo/bar/thing`\\n\\t- Then path hierarchies can be show to users\\n\\nThe last part is important as  (currently) arbitrary path names do not work as **operations** are also specified in the path:  `https://app.metapage.io/<user>/<name>/edit`\\n\\n\\n## Solution {#7c09073f222448ad8bcac4b0402f6281}\\n\\n- `foo/bar/thing` is a valid metapage name\\n- Anything after `/<user>/` is the metapage name\\n- Operations use query parameters\\n\\t- `?view=edit`, `?view=default`, `?view=minimal` or whatever\\n- State is hash parameters"},{"id":"/590e31dd-740b-43ce-9667-a2879651a392","metadata":{"permalink":"/blog/590e31dd-740b-43ce-9667-a2879651a392","source":"@site/blog/How-to-get-SharedArrayBuffer-and-cross-domain-isolation-with-metapage.io.mdx","title":"How to get SharedArrayBuffer and cross-domain isolation with metapage.io","description":"Guide","date":"2023-10-05T17:33:10.754Z","formattedDate":"October 5, 2023","tags":[],"readingTime":0.23,"hasTruncateMarker":false,"authors":[],"frontMatter":{"title":"How to get SharedArrayBuffer and cross-domain isolation with metapage.io","sidebar_position":4,"slug":"/590e31dd-740b-43ce-9667-a2879651a392"},"prevItem":{"title":"metapage URL schema","permalink":"/blog/7965915b-b0e5-401d-b5ad-246e4812aa97"},"nextItem":{"title":"Greatest Information Technology of Humans","permalink":"/blog/greatest-tech-in-time"}},"content":"## Guide {#3f4d0b9c861841898be9dcf084a1317b}\\n\\n\\n[https://web.dev/cross-origin-isolation-guide/](https://web.dev/cross-origin-isolation-guide/)\\n\\n\\n## Main site must serve these headers: {#5de1b86a22fe47fbb4674eac29a656f1}\\n\\n- `Cross-Origin-Opener-Policy`: `same-origin`\\n- `Cross-Origin-Embedder-Policy`: `require-corp`\\n\\n## Iframe/metaframe site must serve these headers: {#2442d6ae453f45ee9b05da80821f055e}\\n\\n- `Cross-Origin-Opener-Policy`: `same-origin`\\n- `Cross-Origin-Embedder-Policy`: `require-corp`\\n- `Cross-Origin-Resource-Policy`: `cross-origin`\\n\\nWhen these stars are aligned, `ffmpeg.wasm` works in a metaframe:\\n\\n\\n![](./2030675540.png)"},{"id":"/greatest-tech-in-time","metadata":{"permalink":"/blog/greatest-tech-in-time","source":"@site/blog/greatest-tech-in-time.mdx","title":"Greatest Information Technology of Humans","description":"It is unlikely that humans are the first to develop story-based deep-time cultural information persistence on this planet.","date":"2023-10-05T17:33:09.826Z","formattedDate":"October 5, 2023","tags":[],"readingTime":1.865,"hasTruncateMarker":false,"authors":[],"frontMatter":{"title":"Greatest Information Technology of Humans","sidebar_position":3,"slug":"/greatest-tech-in-time"},"prevItem":{"title":"How to get SharedArrayBuffer and cross-domain isolation with metapage.io","permalink":"/blog/590e31dd-740b-43ce-9667-a2879651a392"},"nextItem":{"title":"Metapages Deep Time","permalink":"/blog/metapages-are-deep-time-persistent"}},"content":"```mermaid\\nflowchart LR\\n    A[ Stories] --\x3e C[\\"High-fidelity stories\\"]\\n    B[Three people per story] --\x3e C\\n    C --\x3e D[\\"lasting thousands of years\\"]\\n    D --\x3e |means| E[\\"Long term information persistence\\"]\\n```\\n\\n\\n:::tip\\n\\nIt is unlikely that humans are the first to develop story-based deep-time cultural information persistence on this planet.\\n\\n:::\\n\\n\\n\\n\\n## Problem: information degrades over time {#cd01f6f926174670b3beb309162e0ddf}\\n\\n\\nHuman-created and biologically-evolved information systems have overlapping problems and have developed similar solutions.\\n\\n\\nHard-drives wear out, DNA sequences break and accumulate mutations, cosmic rays flib bits, DNA+RNA do not have 100% fidelity on copy, and so on.\\n\\n\\n`some cool pic here: stable diffusions???`\\n\\n\\nThe solution is: `multiple copies`\\n\\n\\nWhile there are greater and lesser solutions at different stages and processes, duplication is the primary and most important mechanism for maintaining information consistency (right word?) over time.\\n\\n\\nCloud data storage maintains multiple copies of the data in different locations so that the loss of a hard-drive unit (which happens at some frequency) is handled (mostly) automatically by software+hardware systems.\\n\\n\\nBiological systems use:\\n\\n- DNA is double-stranded (the spare strand can be used for fixing errors)\\n- multiple copies of chromosomes\\n- Species are populations with multiple copies\\n\\nCultural systems use:\\n\\n- writing\\n- visual art\\n- music and spoken word\\n- places as physical anchors/markers/symbols\\n- others?\\n- digital storage of words, videos, sounds\\n\\nWe think of think of written words as having more durability than spoken word but:\\n\\n- languages evolve over time and reach a point where we cannot read the writing even if in stone (rosetta stone needed for Egyptian hieroglyphs)\\n- written word is archival unless read or spoken\\n- written/carved words can be burnt/destroyed/decayed by time\\n\\nAs long as the words (stories and songs) are spoken and sung in each generation, then the persistence is potentially forever.\\n\\n\\nThus:\\n\\n- deep time cultures must minimize large-scale wars as these cause genocide and thus erasure of deep-time information\\n- shallow-time cultures may not have the larger collective awareness of the long-term consequence of such loss events\\n- parasitic elements of deep time entities can consume the stored entropy of complex information (akin to, or literally, burning books for warmth)\\n\\n## Calendars, human measurements of time {#a0c78e5a7bb44d96bf7c4c3ab6bb3a03}\\n\\n\\nMayan calendar uses all visible planets, 49 year period\\n\\n\\n[https://www.popularmechanics.com/science/archaeology/a43645858/how-the-mayan-calendar-works/](https://www.popularmechanics.com/science/archaeology/a43645858/how-the-mayan-calendar-works/)"},{"id":"/metapages-are-deep-time-persistent","metadata":{"permalink":"/blog/metapages-are-deep-time-persistent","source":"@site/blog/metapages-are-deep-time-persistent.mdx","title":"Metapages Deep Time","description":"The promise:","date":"2023-10-05T17:33:08.362Z","formattedDate":"October 5, 2023","tags":[],"readingTime":0.68,"hasTruncateMarker":false,"authors":[],"frontMatter":{"title":"Metapages Deep Time","sidebar_position":2,"slug":"/metapages-are-deep-time-persistent"},"prevItem":{"title":"Greatest Information Technology of Humans","permalink":"/blog/greatest-tech-in-time"},"nextItem":{"title":"Metapages Origin","permalink":"/blog/metapages-history"}},"content":"The promise:\\n\\n\\nmetapages, or objects derived from metapages, can be dehydrated (stored) and then re-hydrated and run **forever**\\n\\n\\n:::tip\\n\\nA commitment to deep time is a promise to the future\\n\\n:::\\n\\n\\n\\n\\nIndividuals cannot make effective promises to the future, due to EOL/TTL, but groups and organizations can\\n\\n\\n\\n:::tip\\n\\nConcentrated hierarchical power in organizations leads to instabilities: personalities overrides the distributed information flow that makes up long-term agreements and values\\n\\n:::\\n\\n\\n\\n\\n## forever {#9a13c532c8ff476ca92ebc95cd95620a}\\n\\n\\nRequires:\\n\\n- object (data blob) storage\\n- DNS (serve content from addresses)\\n- scientifically critical software (e.g. libraries, tools) in object storage\\n- compute resources (virtual machines)\\n\\nThese are not something this organization can do alone: it is a long-term, multi-organization endeavour. But _with_ and building on those pre-requisites, the metapages organization aims to provide the tooling and infrastructure to provide deep-time durability"},{"id":"/metapages-history","metadata":{"permalink":"/blog/metapages-history","source":"@site/blog/metapages-history.mdx","title":"Metapages Origin","description":"Metapages are a way to solve problems that arose repeatedly during my work in different multi-disciplinary scientific+software workplaces.","date":"2023-10-05T17:33:07.958Z","formattedDate":"October 5, 2023","tags":[],"readingTime":1.555,"hasTruncateMarker":false,"authors":[],"frontMatter":{"title":"Metapages Origin","sidebar_position":1,"slug":"/metapages-history"},"prevItem":{"title":"Metapages Deep Time","permalink":"/blog/metapages-are-deep-time-persistent"},"nextItem":{"title":"URL Configured Websites","permalink":"/blog/url-configured-websites"}},"content":"Metapages are a way to solve problems that arose repeatedly during my work in different multi-disciplinary scientific+software workplaces.\\n\\n\\nProblems and observations:\\n\\n- the time of software developers is a limited resource\\n\\t- but collaborations produce leaps instead of incremental steps\\n- it\'s hard to share code and complex workflows\\n\\t- but when possible, progress accelerates\\n- reproducing workflows and scientific processes can be too time-consuming to be practical\\n\\t- there is a tight relationship between durability, sharing, and reproducibility\\n- sometimes you want to share a piece of a complex workflow/app but it\'s too tied up to be practical\\n\\t- isolating chunks of code into re-usable components is as-ever very useful when possible\\n- mixing backend and front-end code is overly complex for one-off workflows\\n\\t- but is powerful\\n- open-source software is key\\n\\nIn most groups that I have been fortunate to work with, we ended up going down very similar paths, or at least, attempting to solve some of the same subset of problems.\\n\\n\\nAnd new technical innovations can suddently change the landscape, such as docker, where previously it was impractical to share reproducible compute environments, then rapidly became trivial.\\n\\n\\n### Metapages {#d834df68f5e24fa5b2ae093830d6e41c}\\n\\n\\nMetapages solves the following set of inter-related problems:\\n\\n- How to share arbitrarily complex applications and workflows\\n- Sharing and storage are interconnected: how to store \ud83d\udc46\\n- How to lower the barriers of creating and editing\\n- How to automatically run apps and workflows in the future [deep-time-promise]\\n\\n## Reference and footnotes {#7a88c69baac141b89e458ae2bf0a6d99}\\n\\n- `deep-time-promise`\\n- How to empower scientists to share their ideas\\n- How to add add useful tools in the places where needed\\n- And all this\\n\\nOften, small pieces of code in just the right place is all that is needed to unblock and thus accelerate the workflow.\\n\\n\\nBut make and deploying software and code can be overly time-consuming and complex.o"},{"id":"/url-configured-websites","metadata":{"permalink":"/blog/url-configured-websites","source":"@site/blog/url-configured-websites.mdx","title":"URL Configured Websites","description":"Use URL hash parameters to store large amounts of user configured data","date":"2023-10-05T17:33:06.670Z","formattedDate":"October 5, 2023","tags":[],"readingTime":1.81,"hasTruncateMarker":false,"authors":[],"frontMatter":{"title":"URL Configured Websites","sidebar_position":0,"slug":"/url-configured-websites"},"prevItem":{"title":"Metapages Origin","permalink":"/blog/metapages-history"}},"content":"## Use URL hash parameters to store large amounts of user configured data {#860200b321864bc9ba1813824f3aab7c}\\n\\n\\n:::tip\\n\\nIt gives users much more control and creativity over websites\\n\\n:::\\n\\n\\n\\n\\n[https://mermaid.live/](https://mermaid.live/) is an excellent example. As soon as you go to that link, the link looks long: that\u2019s because it has encoded the diagram it displays completely in the URL hash parameters:\\n\\n\\n![](./1164251445.png)\\n\\n\\nURL:\\n\\n\\n[https://mermaid.live/edit#pako:eNpVjk2Lg0AMhv9KyGkL9Q94WGh1t5fCFurN6SFo7AztfDBGpKj_fcd62c0pvM_zhkzY-JYxx-7px0ZTFKhK5SDNoS50NL1Y6m](https://mermaid.live/edit#pako:eNpVjk2Lg0AMhv9KyGkL9Q94WGh1t5fCFurN6SFo7AztfDBGpKj_fcd62c0pvM_zhkzY-JYxx-7px0ZTFKhK5SDNoS50NL1Y6m-QZZ_ziQWsd_ya4fhx8tBrH4Jx993mH1cJium8agyijXssGyre_R_HM5T1mYL4cPtLqtHP8FWbi07n_xMdObW-647yjrKGIhQU3wru0XK0ZNr0_rQmCkWzZYV5WlvuaHiKQuWWpNIg_vpyDeYSB97jEFoSLg3dI9ktXH4B_cJWqw)\u2026 (I cut it for readability)\\n\\n\\nWhat is happening?\\n\\n- The code that describes the diagram is encoded and store in the hash parameters (after the `#`) of the URL.\\n- That URL can now be shared and directly edited\\n- No backend server is involved in storing the data, only for serving the assets (a _**static**_ website)\\n- Everything after the `#` is **NOT** sent to the server\\n\\n## Modern browsers can handle very large URLs {#d32c6439fe384d90b342350311b68d89}\\n\\n\\nIn 2006, [IE8s URL limit was 2083 characters](https://support.microsoft.com/en-us/kb/208427). [IE9 has a similar limit](https://stackoverflow.com/questions/3721034/how-long-of-a-url-can-internet-explorer-9-take). \\n\\n\\n[The original HTTP/1.1 specification put no limit on the length of the URL](http://www.faqs.org/rfcs/rfc2616.html)\\n\\n\\nIn 2022, a new update was published [and says](https://www.rfc-editor.org/rfc/rfc9110#section-4.1-5):\\n\\n\\n> It is RECOMMENDED that all senders and recipients support, at a minimum, URIs with lengths of 8000 octets in protocol elements. Note that this implies some structures and on-wire representations (for example, the request line in HTTP/1.1) will necessarily be larger in some cases.\\n\\n\\nHowever, this is talking about URLs over the wire. For the browser address bar itself, limits are much much higher:\\n\\n\\n```text\\nBrowser     Address bar   document.location\\n                          or anchor tag\\n------------------------------------------\\nChrome          32779           >64k\\nAndroid          8192           >64k\\nFirefox          >64k           >64k\\nSafari           >64k           >64k\\nIE11             2047           5120\\nEdge 16          2047          10240\\n```\\n\\n\\nSource: [https://stackoverflow.com/questions/417142/what-is-the-maximum-length-of-a-url-in-different-browsers](https://stackoverflow.com/questions/417142/what-is-the-maximum-length-of-a-url-in-different-browsers)\\n\\n\\n## You can store large amounts of code in the hash parameters, and allow users to configure complex websites {#852ea18949cc47ad9c89488cf81019ce}\\n\\n\\nExample: embed 3D code (that is editable)\\n\\n\\n[embed](https://app.metapages.org/#?&hide-header=true)\\n\\n\\n[Link to source](https://app.metapages.org/#?&hide-header=true)\\n\\n\\nIn the example above, enough code was embedded in the link to describe a 3D with a bunch of complex behaviour. Someone else can take that URL, and directly modify it, run it, then share the modified URL. \\n\\n\\nThis way, apps can be both self-contained, but also highly configurable and shareable, allowing a high degree of direct collaboration not under centralized control."}]}')}}]);